import React from 'react';
import Navbar from './components/Navbar'

import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from 'react-router-dom';

function App() {
  return (
    <Router>
      <Navbar />

      <Switch>
        <Route exact path="/">
          <h1>Home</h1>
        </Route>
        <Route path="/addTeam">
          <h1>Add team</h1>
        </Route>
        <Route path="/addMatch">
        <h1>Add match</h1>
        </Route>
      </Switch>

    </Router>
  );
}

export default App;
